import React, { useState, useEffect, useRef } from 'react'
import css from 'styled-jsx/css'


export default function CreateTicket() {

  return <div className='CreateTicketForm'>
    CreateTicketForm
    <style jsx>{ style }</style>
  </div>
}


// language=Stylus
const style = css`
  .CreateTicketForm {
    background-color blue
  }
`
